DROP TABLE IF EXISTS `std_region`;
CREATE TABLE `std_region` (
  `region_code` int(11) NOT NULL,
  `region_name` varchar(100) NOT NULL,
  `region_level` int(11) DEFAULT NULL,
  `parent_region_code` int(11) NOT NULL,
  `region_full_code` varchar(255) DEFAULT NULL COMMENT '全部code,如11010.1111.1112',
  `region_full_name` varchar(255) DEFAULT NULL COMMENT '全名称如浙江.杭州.滨江',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `version` smallint(6) NOT NULL DEFAULT '0' COMMENT '每次更新的版本号，便于做用于乐观锁',
  `create_user_uuid` varchar(64) DEFAULT NULL COMMENT '录入人唯一标识',
  `create_time` varchar(20) DEFAULT NULL COMMENT '录入日期格式:YYYY-MM-DD hh:mm:ss',
  `update_user_uuid` varchar(64) DEFAULT NULL COMMENT '修改人标识',
  `update_time` varchar(20) DEFAULT NULL COMMENT '修改日期YYYY-MM-DD hh:mm:ss',
  `valid_flag` tinyint(4) NOT NULL DEFAULT '1' COMMENT '有效标识，1正常，0删除',
  `id` bigint(32) NOT NULL,
  `sys_remark` varchar(255) DEFAULT NULL COMMENT '系统备注，便于后面扩展',
  `name_rev` varchar(100) GENERATED ALWAYS AS (reverse(`region_name`)) VIRTUAL,
  PRIMARY KEY (`region_code`),
  KEY `std_area_idx_parent_region_code` (`parent_region_code`) USING BTREE,
  KEY `idx_reverse_std_area_name` (`name_rev`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC;

